Enter the erotic world of Linda Wong as you would enter the legend herself. Not quite knowing what to expect, lust of course, and bizzare sensuality. The unknown, the final twist that takes you into excruciating pleasure. Whether it be with ...    Full Descriptiona prince like Mike Horner, and his courtesan, Vanessa Taylor, a sweaty encounter with two of her servants Billy Dee and Jon Martin, the introduction of a neophyte, Richard Pacheco, or the seduction of two young women Cindy Carver and Ashley Wells. Linda Wong is always herself, a woman beyond passion. Sometimes dominant and terrifying. Sometimes so soft that men and women melt in her arms. Always she pushes, pushes you to the edge of your own desires.
